import React, { useState } from "react";
import "./App.css";

function App() {
  const [stuff, setStuff] = useState();

  function fetchData() {
    fetch(
      "https://www12.statcan.gc.ca/rest/census-recensement/CPR2016.json?lang=E&topic=10&dguid=2016A00053520005"
    ).then(response =>
      response.text().then(text => {
        let jsonFile = JSON.parse(text.slice(2));
        //after this, there will be one array with 800+ objects. Each object has 19 keys
        let jsonObject = jsonFile.DATA.map(rowArr =>
          rowArr.reduce(
            (rowObject, value, i) => ({
              ...rowObject,
              [jsonFile.COLUMNS[i]]: value
            }),
            {}
          )
        ); //.filter(r => r.TEXT_NAME_NOM.includes("Korean"));
      })
    );
  }

  return (
    <div className="App">
      <h1>This thing</h1>
    </div>
  );
}

export default App;
